import React from 'react'
import { sortStore } from '../../assets/static/data'
import { ISortType } from '../../Model/appModel'
import SortVisualizer from '../Components/SortVisualizer'
import SortInfoCard from '../Components/SortInfoCard'

const Iterator = () => {
  return (
    <>
    {
      sortStore.map((sortData: ISortType) => {
       return <div className='w-full m-5'>
                <div className='w-full flex flex-row justify-around'>
                  <SortInfoCard name={sortData.name}/>
                  <SortVisualizer sortName={sortData.name}/>
                </div>
              </div>
      }
    )}
    </>
  )
}

export default Iterator
